import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom'


import './assets/main.css';
import App from './app';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
  <provider>
        <App />
   </provider>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
  );
